some basic concepts

virtual DOM
React uses virtual DOM to enhance its performance. It uses the observable to detect state and prop changes. React uses an efficient diff algorithm to compare the versions of virtual DOM. It then makes sure that batched updates are sent to the real DOM for repainting or re-rendering of the UI.

PROPS vs STATE
The state is a data structure that starts with a default value when a Component mounts. It may be mutated across time, mostly as a result of user events.
Props (short for properties) are a Component&#x2019;s configuration. Props are how components talk to each other. They are received from above component and immutable as far as the Component receiving them is concerned.

React vs React Native
In Reactjs, virtual DOM is used to render browser code in Reactjswhile in React Native, native APIs are used to render components in mobile.


